        const maxReturn = Math.max(...returnsData);
        const bins = 50;
        const binSize = (maxReturn - minReturn) / bins;
        const histogram = Array(bins).fill(0);
        const binLabels = [];
        
        for (let i = 0; i < bins; i++) {
            binLabels.push(((minReturn + i * binSize) * 100).toFixed(1) + '%');
        }
        
        returnsData.forEach(returnVal => {
            const binIndex = Math.min(Math.floor((returnVal - minReturn) / binSize), bins - 1);
            histogram[binIndex]++;
        });

        const returnsOption = {
            title: {
                text: 'Distribution of Returns',
                subtext: 'Histogram of 10,000 simulation outcomes',
                left: 'center'
            },
            tooltip: {
                trigger: 'axis',
                axisPointer: { type: 'shadow' }
            },
            grid: {
                left: '3%',
                right: '4%',
                bottom: '3%',
                containLabel: true
            },
            xAxis: {
                type: 'category',
                data: binLabels,
                name: 'Return (%)'
            },
            yAxis: {
                type: 'value',
                name: 'Frequency'
            },
            series: [{
                name: 'Returns',
                type: 'bar',
                data: histogram,
                itemStyle: {
                    color: '#70a1ff'
                },
                markLine: {
                    data: [
                        {
                            yAxis: 26.06,
                            name: 'Mean Return',
                            lineStyle: { color: '#3742fa', width: 2 }
                        },
                        {
                            yAxis: -27.55,
                            name: '5% VaR',
                            lineStyle: { color: '#ff4757', width: 2, type: 'dashed' }
                        }
                    ]
                }
            }]
        };
        returnsChart.setOption(returnsOption);

        // Handle window resize
        window.addEventListener('resize', () => {
            stockChart.resize();
            returnsChart.resize();
        });
    </script>
</body>
</html>
